import React from 'react'
import Logo from '../../images/logo.png'
import LogoHoriz from '../../images/LogoHoriz.png'
import LogoSolo from '../../images/LogoSolo.png'
const Navbar = () => {
  var nav = $('nav');
  var line = $('<div />').addClass('line');

  line.appendTo(nav);

  var active = nav.find('.active');
  var pos = 0;
  var wid = 0;

  if(active.length) {
    pos = active.position().left;
    wid = active.width();
    line.css({
      left: pos,
      width: wid
    });
  }

  nav.find('ul li a').click(function(e) {
    e.preventDefault();
    if(!$(this).parent().hasClass('active') && !nav.hasClass('animate')) {

      nav.addClass('animate');

      var _this = $(this);

      nav.find('ul li').removeClass('active');

      var position = _this.parent().position();
      var width = _this.parent().width();

      if(position.left >= pos) {
        line.animate({
          width: ((position.left - pos) + width)
        }, 300, function() {
          line.animate({
            width: width,
            left: position.left
          }, 150, function() {
            nav.removeClass('animate');
          });
          _this.parent().addClass('active');
        });
      } else {
        line.animate({
          left: position.left,
          width: ((pos - position.left) + wid)
        }, 300, function() {
          line.animate({
            width: width
          }, 150, function() {
            nav.removeClass('animate');
          });
          _this.parent().addClass('active');
        });
      }

      pos = position.left;
      wid = width;
    }
  });



  return (
<nav class="bg-[#1C5367] border-b-2 border-[#C4A962]">
  <div class="max-w-7xl mx-auto px-2 sm:px-6 lg:px-8">
    <div class="relative flex items-center justify-between h-16">

      <div class="flex-1 flex items-center justify-center sm:items-stretch sm:justify-start">
        <div class="flex-shrink-0 flex items-center">
          <img class="block lg:hidden h-12 w-auto" src={LogoSolo} alt="Harmony United LLC Logo"></img>
          {/* <p class="block lg:hidden h-12 w-auto">Harmony United LLC</p>  */}
          <img class="hidden lg:block h-12 w-auto" src={LogoSolo} alt="Harmony United LLC Logo"></img>
          <p class="text-center max-h-12 text-[#FDD017] text-sm">Harmony United <br/>Research LLC</p> 
        </div>
        <div class="hidden sm:block sm:ml-6 items-center">
          <div class="flex space-x-4 h-full items-center">
            {/* <a href="/" class="text-[#F5CD00] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-medium" aria-current="page">Home</a> */}
            {/* <a href="/" class="text-[#FFE10A] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-medium" aria-current="page">Home</a> */}
            <a href="/" class="text-[#FDD017] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-large" aria-current="page">Home</a>
            {/* <a href="/" class="text-[#DAA520] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-medium" aria-current="page">Home</a> */}

            <a href="/aboutus" class="text-[#FDD017] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-medium">About Us</a>

            <a href="/contact" class="text-[#FDD017] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-medium">Contact Us</a>
          </div>
        </div>
      </div>
      <div class="absolute inset-y-0 right-0 flex items-center pr-2 sm:static sm:inset-auto sm:ml-6 sm:pr-0">
            <a href="/signup" class="text-[#FDD017] hover:bg-[#C4A962] hover:text-white px-3 py-2 rounded-md text-sm font-medium">Sign Up for Trial</a>
        <div class="ml-3 relative">
        </div>
      </div>
    </div>
  </div>

  <div class="sm:hidden" id="mobile-menu">
    <div class="px-2 pt-2 pb-3 space-y-1">
      <a href="#" class="bg-gray-900 text-white block px-3 py-2 rounded-md text-base font-medium" aria-current="page">Home</a>

      <a href="#" class="text-gray-300 hover:bg-gray-700 hover:text-white block px-3 py-2 rounded-md text-base font-medium">About Us</a>

      <a href="#" class="text-gray-300 hover:bg-gray-700 hover:text-white block px-3 py-2 rounded-md text-base font-medium">Contact Us</a>

      <a href="#" class="text-gray-300 hover:bg-gray-700 hover:text-white block px-3 py-2 rounded-md text-base font-medium">Sign Up For Trial</a>
    </div>
  </div>
</nav>

